import Nav from "./Navbar";
import Storis from "./Stories";
import Create from "./Create";
import Post from "./Post";
import NavL from "./NavL";
const Appp =()=>{
    return(
        <div>
        <Nav />
    <Storis />
    <Create />
    <Post />
    <NavL />
    </div>
    )
}
export default Appp;
